import React from 'react';
import './App.css';

const Menu5Img = () => {
  return (
    <section className='Menu5Img'>
      <div className='imgMenu5'></div>
      <div className='imgMenu6'></div>
      <div className='imgMenu7'></div>
    </section>
  );
};

export default Menu5Img;
